import React from 'react';
import avatarEditButton from '../images/Vector.svg';
import PopupWithForm from './PopupWithForm';
import ImagePopup from './ImagePopup';

function Main() {
  return (
    <div>
      <main>
        <section className="profile">
          <div className="profile__info">
            <div className="profile__avatar">
              <img className="profile__avatar-photo" src="#" alt="Фотография пользователя в профайле" />
              <img className="profile__avatar-edit" src={avatarEditButton} alt="Иконка редактирования аватарки" />
            </div>
            <div className="profile__description">
              <h1 className="profile__name">Жакки Кусто</h1>
              <button className="profile__edit-button" aria-label="Редактирование профиля" type="button"></button>
              <p className="profile__job">Ученый</p>
            </div>
          </div>
          <button className="profile__add-button" aria-label="Добавление контента в профиль" type="button"></button>
        </section>
        <div className="place-container"></div>
      </main>
      <PopupWithForm />
      <ImagePopup />
    </div>
  );
}

export default Main;
